const ajiData = [
  {
    id: "image",
    data: "data:image/png;base64,",
  },
];

let startTime = null;
let record = 0.0;
let diff = 0;
let count = 0;

function setup() {
  ajiSetBG(0, "image");
}

function loop() {
  ajiDrawBG(0, 0, 0);
  ajiSetFillColor("black");
  if (count == 0) {
    ajiSetFont("44px sans-serif");
    ajiDrawAlignText(record.toFixed(2), 0, 145, AJIPACK_WIDTH, "center");
    ajiSetFont("16px sans-serif");
    ajiDrawAlignText(
      "目標との差: " + diff.toFixed(2) + "秒",
      0,
      175,
      AJIPACK_WIDTH,
      "center"
    );
  } else if (count == 1) {
    ajiSetFont("44px sans-serif");
    ajiDrawAlignText("計測中", 0, 145, AJIPACK_WIDTH, "center");
  }
  if (ajiClick()) {
    if (count == 0) {
      startTime = Date.now();
    } else if (count == 1) {
      record = (Date.now() - startTime) / 1000;
      diff = Math.abs(record - 10);
    }
    count++;
    if (count >= 2) {
      count = 0;
    }
  }
}
